import React from 'react'
import { useState, useEffect } from 'react';
import { Navigate, useNavigate } from 'react-router-dom';
import Navbar from '../../components/Navbar';
import Piechart from '../../components/Piechart';
import TicketsbyStatus from '../../components/TicketsbyStatus';
import TicketsbyType from '../../components/TicketsbyType';



function UserDashboard({user}) {


  let navigate = useNavigate()

  console.log(user);


  return (
    <div className='conatiner'>
      <Navbar />
     <h1> {user.first_name}'s Dashboard </h1> 
      <div class="row">
      <div class="card mx-auto h-50" style={{width: 1050}}>
  <div class="col-sm-6">
    <div class="card">
      <div class="card-body">
        <h5 class="card-title">Tickets by Type</h5>
       {user && <TicketsbyType user={user}/>}
      </div>
    </div>
  </div>
  <div class="col-sm-6">
    <div class="card">
      <div class="card-body">
        <h5 class="card-title">Tickets by priority</h5>
        {user &&  <Piechart user={user}/>}
      </div>
    </div>
  </div>
  <div class="col-sm-6">
    <div class="card">
      <div class="card-body">
        <h5 class="card-title">Tickets by Status</h5>
        {user && <TicketsbyStatus user={user}/>}
      </div>
    </div>
  </div>
  </div>
</div>
</div>
  )
}

export default UserDashboard
